import ReactDOM from 'react-dom';

const fullname = 'Monika Pawar';
const gender = "male";

if(gender=="male"){
    gendertype = 'He';
}else{
    gendertype = 'She';
}

var root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.Fragment>
        <p>This is {fullname}. And {gendertype} is one of the good way solve problems.</p>
    </React.Fragment>
);
